import tableau from 'tableau-api';

const Analytics = () => {
  const vizUrl = 'https://public.tableau.com/app/profile/katherine.jones7818/viz/SampleDataChecks/Samples';
  const vizContainer = this.vizContainer;
  let viz = new window.tableau.Viz(vizContainer, vizUrl)

  return (
    <div className="analytics" ref={(div) => { this.vizContainer = div }}>

    </div>
  );
}

export default Analytics;
